function getUserData() {
    fetch('http://127.0.0.1:8000/api/dish_view/', {
        method: 'POST',
        mode: 'no-cors',
        headers: {},
        body: JSON.stringify({'data': 'myData'})
    })
        .then(response => response.json())
        .then(data => {
            console.log(data)
        })
}

export default getUserData
